Description_lang:
Utilisées pour améliorer l’équipement d’aventure ou vétéran dans la saison 2 de The War Within, jusqu’à un niveau d’objet 623-632. Obtenues grâce aux activités suivantes :

– évènements en extérieur répétables ;
– Libération de Terremine (outil Raids) ;
– donjons de saison (héroïque) ;
– Gouffres (niveaux 1 à 5).

Utilisées pour améliorer l’équipement vétéran et de champion dans la saison 2 de The War Within, jusqu’au niveau 636-645. Obtenues grâce aux activités suivantes :

– évènements en extérieur hebdomadaires ;
– Libération de Terremine (normal) ;
– donjons de saison (mythique) ;
– Gouffres (niveaux 6 et 7) ;
– butin de l’archéologue (niveaux 4 et 5).

Utilisées pour améliorer l’équipement de champion et héroïque dans la saison 2 de The War Within, jusqu’au niveau 649-658. Obtenues grâce aux activités suivantes :

– Libération de Terremine (héroïque) ;
– donjons de clé mythique (de +2 jusqu’à +6) ;
– Gouffres (niveaux 8 à 11) ;
– butin de l’archéologue (niveaux 6 et 7).

Utilisées pour améliorer l’équipement héroïque et mythique dans la saison 2 de The War Within, pour les objets de niveau 662 et plus. Obtenues grâce aux activités suivantes :

– Libération de Terremine (mythique) ;
– donjons de clé mythique (+7 et suivants) ;
– réserve dorée de Gouffres (niveau 11) ;
– butin de l’archéologue (niveau 8+).

